import './App.css';
import { BrowserRouter } from 'react-router';

function App() {
  return (
    <BrowserRouter>
    <div className="App">
      <header className="App-header">
        <p>
          Edit <code>src/App.tsx</code> and save to reload.
        </p>
      </header>
    </div>
    </BrowserRouter>
  );
}

export default App;
